Input: $\alpha, \beta, \sigma$, Noise Dist , particle_creation_probability
Output: Simulated lattice
Initialize YangMillsSimulator with parameters;
for $t$ from 0 to $T$ do
Calculate mass gap using $\alpha[t]$;
for $x$ in lattice do
if rand() < particle_creation_probability then
Simulate particle creation at $(x, t)$;
end
end
end
Simulate lattice;

## I tô FormulaA FOR JUMP-Diffusion.

The Itô formula for jump-diffusion is a generalization of the Itô formula to include jumps. It describes the evolution of a stochastic process that experiences both continuous diffusion and discrete jumps.

Knowing that the Black-Scholes equation is a backward diffusion process, we can then write this algorithm.

