Algorithm 6: Itô Formula for Jump-Diffusion
Data: $x, t, \alpha, \beta, \sigma$, jump_size_dist
Result: Updated state $x$ after applying the Itô formula for jump-diffusion.
$x \leftarrow x$
for $t$ from 0 to $T$ do
$t \leftarrow \min (t$, length $(\alpha)-1)$;
drift $\leftarrow$ non_linear_drift $(x, t)$;
diffusion $\leftarrow \sigma[t] \cdot \operatorname{normal}(0,1)$;
num_jumps $\leftarrow$ poisson(1000);
jump_sizes $\leftarrow$ jump_size_dist(normal(0, 1, num_jumps));
jump_effect $\leftarrow \sum_{t=1}^{\text {num_jump }} \mathrm{jump}_{-} \mathrm{sizes}[t] ;$
$x \leftarrow$ drift + diffusion + jump_effect;
end
return $x$

